import './style.css'

import axios from 'axios';
import { useState } from 'react';
// import { Axios } from 'axios';

function Admin() {
  
  const [userName,setuserName]=useState('');
  const [passWord,setPassWord]=useState('');

  const fLogin=async ()=>{
    axios.post('http://localhost:5000/api/admins/login',{
      username: userName,
      password: passWord,
    }).then(response=>{
      console.log(response)
    });
    // axios({
