    //   data: {
        
    //   }
    // }).then(response=>{
    //   console.log(response)
    // });
  };

  

  return (                                  
    <div id="html">
      {/* Pháº§n content */}
      <div class="login-panel" >
        <h2>Admin</h2>
        <br />
        <input type="text" placeholder="Enter user" onChange={(e)=>{
          setuserName(e.target.value);
        }} />
        <input type="password" placeholder="Enter password" onChange={(e)=>{
          setPassWord(e.target.value);
        }} />
        <div className="check">
          <label >    
            <input  type="checkbox" />
            Remember me
            </label>
        </div>
        <br />
        <button onClick={()=>fLogin()}>
          Log in
        </button>        
      </div>
    </div>           
  );
}
export default Admin;
